import React from 'react'
import { useDispatch } from 'react-redux'

const ContactCard = ({el}) => {
  return (
    <div style={{border:'solid red', width:'360px'}}>
        {el.name}<br/>
        {el.email}<br/>
        {el.phone}<br/>
        <button>edit</button> <button>delete</button>
    </div>
  )
}

export default ContactCard
